const tbody = [
  {
    className: "table-success",
    data: ["Advogado", "14/07/2018", "14/07/2019"]
  },
  {
    className: "",
    data: ["Panfleto", "12/10/2018", "13/10/2018"]
  },
  {
    className: "table-info",
    data: ["Auxiliar TI", "02/09/2018", "28/09/2018"]
  },
];

// data for <thead> of table in TableList view
// data for <tbody> of table in TableList view
